            {chat.like}
          </p>
          <hr />
          <div>
            <TagsOutlined />
            {chat.tags.map((tag) => {
              return <span>{tag} </span>;
            })}
          </div> */}
        </Card>
      );
    });
  }

  return (
    <>
      <div className="site-card-wrapper">
        <Row gutter={16}>
          <Col span={3}>
            <Card title="Card title" bordered={false}>
              Card content
            </Card>
          </Col>
          <Col span={3}>
            <Card title="Card title" bordered={false}>
              Card content
            </Card>
          </Col>
          <Col span={3}>
            <Card title="Card title" bordered={false}>
              Card content
            </Card>
          </Col>
        </Row>
      </div>
      <div className="site-card-wrapper">
        <Row gutter={16}>
          <Col span={3}>{renderOpenChatList()}</Col>
        </Row>
      </div>
      ,
    </>
  );
}

export default App;
